-- Table structure for pzq_goods
-- ----------------------------
DROP TABLE IF EXISTS `pzq_goods`;
CREATE TABLE `pzq_goods` (
  `goods_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品id',
  `cat_id` int(11) unsigned DEFAULT '0' COMMENT '分类id',
  `extend_cat_id` int(11) DEFAULT '0' COMMENT '扩展分类id',
  `shangjia_id` int(11) DEFAULT '0',
  `goods_sn` varchar(60) DEFAULT '' COMMENT '商品编号',
  `goods_name` varchar(120) DEFAULT '' COMMENT '商品名称',
  `click_count` int(10) unsigned DEFAULT '0' COMMENT '点击数',
  `brand_id` smallint(5) unsigned DEFAULT '0' COMMENT '品牌id',
  `store_count` smallint(5) unsigned DEFAULT '10' COMMENT '库存数量',
  `comment_count` smallint(5) DEFAULT '0' COMMENT '商品评论数',
  `weight` int(11) unsigned DEFAULT '0' COMMENT '商品重量克为单位',
  `market_price` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '市场价',
  `shop_price` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '本店价',
  `cost_price` decimal(10,2) DEFAULT '0.00' COMMENT '商品成本价',
  `keywords` varchar(255) DEFAULT '' COMMENT '商品关键词',
  `goods_remark` varchar(255) DEFAULT '' COMMENT '商品简单描述',
  `goods_content` text COMMENT '商品详细描述',
  `original_img` varchar(100) DEFAULT '' COMMENT '商品上传原始图',
  `scroll_img` varchar(100) DEFAULT NULL,
  `is_real` tinyint(3) unsigned DEFAULT '1' COMMENT '是否为实物',
  `is_on_sale` tinyint(1) unsigned DEFAULT '1' COMMENT '是否上架',
  `is_free_shipping` tinyint(1) unsigned DEFAULT '0' COMMENT '是否包邮0否1是',
  `on_time` int(10) unsigned DEFAULT '0' COMMENT '商品上架时间',
  `sort` smallint(4) unsigned DEFAULT '50' COMMENT '商品排序',
  `is_recommend` tinyint(1) unsigned DEFAULT '0' COMMENT '是否推荐',
  `is_new` tinyint(1) unsigned DEFAULT '0' COMMENT '是否新品',
  `is_hot` tinyint(1) DEFAULT '0' COMMENT '是否热卖',
  `last_update` int(10) unsigned DEFAULT '0' COMMENT '最后更新时间',
  `goods_type` smallint(5) unsigned DEFAULT '0' COMMENT '商品所属类型id，取值表goods_type的cat_id',
  `spec_type` smallint(5) DEFAULT '0' COMMENT '商品规格类型，取值表goods_type的cat_id',
  `give_integral` mediumint(8) DEFAULT '0' COMMENT '购买商品赠送积分',
  `exchange_integral` int(10) DEFAULT '0' COMMENT '积分兑换：0不参与积分兑换，积分和现金的兑换比例见后台配置',
  `suppliers_id` smallint(5) unsigned DEFAULT '0' COMMENT '供货商ID',
  `sales_sum` int(11) DEFAULT '0' COMMENT '商品销量',
  `prom_type` tinyint(1) DEFAULT '0' COMMENT '0 普通订单,1 限时抢购, 2 团购 , 3 促销优惠',
  `prom_id` int(11) DEFAULT '0' COMMENT '优惠活动id',
  `commission` decimal(10,2) DEFAULT '0.00' COMMENT '佣金用于分销分成',
  `spu` varchar(128) DEFAULT '' COMMENT 'SPU',
  `sku` varchar(128) DEFAULT '' COMMENT 'SKU',
  PRIMARY KEY (`goods_id`),
  KEY `goods_sn` (`goods_sn`),
  KEY `cat_id` (`cat_id`),
  KEY `last_update` (`last_update`),
  KEY `brand_id` (`brand_id`),
  KEY `goods_number` (`store_count`),
  KEY `goods_weight` (`weight`),
  KEY `sort_order` (`sort`)
) ENGINE=MyISAM AUTO_INCREMENT=152 DEFAULT CHARSET=utf8;

