  `goods_price` decimal(10,2) DEFAULT '0.00' COMMENT '本店价',
  `shipping_price` varchar(255) DEFAULT NULL COMMENT '邮费',
  `discount` varchar(255) DEFAULT NULL COMMENT '价格调整',
  `cost_price` decimal(10,2) DEFAULT '0.00' COMMENT '商品成本价',
  `coupon_price` varchar(255) DEFAULT NULL COMMENT '优惠券抵扣',
  `integral_money` varchar(255) DEFAULT NULL COMMENT '使用积分抵多少钱',
  `member_goods_price` decimal(10,2) DEFAULT '0.00' COMMENT '会员折扣价',
  `give_integral` mediumint(8) DEFAULT '0' COMMENT '购买商品赠送积分',
  `spec_key` varchar(128) DEFAULT '' COMMENT '商品规格key',
  `spec_key_name` varchar(128) DEFAULT '' COMMENT '规格对应的中文名字',
  `bar_code` varchar(64) DEFAULT '' COMMENT '条码',
  `is_comment` tinyint(1) DEFAULT '0' COMMENT '是否评价',
  `prom_type` tinyint(1) DEFAULT '0' COMMENT '0 普通订单,1 限时抢购, 2 团购 , 3 促销优惠',
  `prom_id` int(11) DEFAULT '0' COMMENT '活动id',
  `is_send` tinyint(1) DEFAULT '0' COMMENT '0未发货，1已发货，2已换货，3已退货',
  `delivery_id` int(11) DEFAULT '0' COMMENT '发货单ID',
  `sku` varchar(128) DEFAULT '' COMMENT 'sku',
  `add_time` int(10) DEFAULT NULL,
  `shipping_time` int(10) DEFAULT NULL COMMENT '最后新发货时间',
  `confirm_time` int(10) DEFAULT NULL COMMENT '收货确认时间',
  `pay_time` int(10) DEFAULT NULL COMMENT '支付时间',
  PRIMARY KEY (`rec_id`),
  KEY `order_id` (`order_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM AUTO_INCREMENT=984 DEFAULT CHARSET=utf8 COMMENT='订单商品信息表';

