INSERT INTO `pzq_hy` VALUES ('3', '0', null, '吴邪', 'e10adc3949ba59abbe56e057f20f883e', null, '7', '10010', '人气模特', '我的家乡在呢？', '房县', '870110116@qq.com', 'yangrui520421', '870110116', '870110116', '黑色', '水瓶座', '蓝色', '开始理解减法是在刚学摄影的时候。那时胶片很贵，不敢随意试拍，只能先学道理。原来，借助物理世界的存在和光线来表达情感竟然是以现实为起点，大胆做开始理解减法是在刚学摄影的时候。那时胶片很贵，不敢随意试拍，只能先学道理。原来，借助物理世界的存在和光线来表达情感，竟然是以现实为起点，大胆做减法，从而“抽”出主题和美来。\r\n\r\n其实，很多艺术都是如此。比如绘画不说极少主义所选择的极少的色与形...……开始理解减法是在刚学摄影的时候。那时胶片很贵，不敢随意试拍，只能先学道理。原来助物理世界的存在和光线来表达情感，竟然是以现实为起点，大胆做减法，从而“抽”出主题和美来。其实，很多艺术都是如此。比如绘画。先不说极少主义所选择的极少的色与形...……减法，从而“抽”出主题和美来。其实，很多艺术都是如此。比如绘画。先不说极少主义所选择的极少的色与形...……\r\n', '中国', '北京', '北京', '中国北京北京石景山区', '13581820409', '石景山区', '1', '22', '/Uploads/20170228/58b53b5c54f05.png', '185', '50', '50', '50', '50', '3', '汽车模特', '', '2', '2', '已认证', '1', 'vip1', '2016-11-02 15:39:48', '2017-03-14 10:30:28', null, null, null, null);
