INSERT INTO `pzq_jgxx` VALUES ('10', '2', '美女公司', '礼仪商务', '私企', '1~1000人', '21届皮皮网达人秀21届皮皮网达人秀冠军寒选美大赛十佳最in模特亚军2009 年荣获最美彩妆亚军携手行天下代言合作21届皮皮网达人秀冠军寒选美大赛十佳最in模特亚军2009 年荣获最美彩妆亚军携手行天下代言合作上海新思路十佳21届皮皮网达人秀冠军寒选美21届皮皮网达人秀冠军寒选美大赛十佳最in模特亚军2009 年荣获最', '北京', '北京', '张总', '13581820409', '全职', '腿模', '业务', '1', '本科', '5000元', '<p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); line-height: 32px; font-family: 微软雅黑; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">负责沈阳大区设计研发及运营管理相关工作，具体如下：</p><p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); line-height: 32px; font-family: 微软雅黑; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">1、产品线研究：负责/参与住宅产品线研究及应用工作。</p><p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); line-height: 32px; font-family: 微软雅黑; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">2、新项目拓展：负责/参与项目拿地前期设计工作。</p><p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); line-height: 32px; font-family: 微软雅黑; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">3、设计标准化：负责/参与组织节点标准化研究/产品标准固化研究/设计导则编制/建筑构造做法标准化研究及修订工作。</p><p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); line-height: 32px; font-family: 微软雅黑; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">4、设计流程管理：负责/参与设计流程建设与优化工作。</p><p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); line-height: 32px; font-family: 微软雅黑; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">5、设计运营管理：负责/参与组织以下几类工作，包括但不限于：会议体系、设计信息化、计划管理、总部对接等设计运营类工作。</p><p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(102, 102, 102); line-height: 32px; font-family: 微软雅黑; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);\">6、设计培训管理：负责/参与建立设计培训体系，组织设计培训开展，并对培训完成情况及效果反馈进行统计。</p><p><br/></p>', '北京', '北京', '朝阳区', '2016-11-14 16:23:40');
