INSERT INTO `pzq_sp` VALUES ('4', '3', '测试1', '111111开始理解减法是在刚学摄影的时候。那时胶片很贵，不敢随意试拍，只能先学道理。原来，借助物理世界的存在和光线来表达情感竟然是以现实为起点，大胆做开始理解减法是在刚学摄影的时候。那时胶片很贵，不敢随意试拍，只能先学道理。原来，借助物理世界的存在和光线来表达情感，竟然是以现实为起点，大胆做减法，从而“抽”出主题和美来。\r\n\r\n其实，很多艺术都是如此。比如绘画不说极少主义所选择的极少的色与形...……开始理解减法是在刚学摄影的时候。那时胶片很贵，不敢随意试拍，只能先学道理。原来助物理世界的存在和光', '/Uploads/upvideo/20161109/5823084e51044.mp4', '2016-11-09 19:31:39', '2016-11-10 09:13:08');
